                                          res.status(400).json({
                                            error: error, message:"Erreur lors de la génération du nouveau token pour la première connection !"
                                          });
                                        }
                                      );                                    
                                    }
                                }                                                                    
                            }
            ).catch(
                (error) => {
                    res.status(500).json({
                        error: error
                    });
                }
            );
        }
    ).catch(
        (error) => {
            res.status(500).json({
